import React from 'react';
import {CardList} from './components/card-list/card-list.component'
import './App.css';

class App extends React.Component{
  constructor(){
    super();
    this.state = {
      projects: [
        {
          name: 'Corona Test',
          id: 'pr1',
          url: `https://github.com/RohanLodhi/amiinfected/blob/master/imgs/awareness.png?raw=true`
        },
        {
          name: 'Simple Weather',
          id: 'pr2'
        },
        {
          name: 'Router Library',
          id: 'pr3'
        },
        {
          name: 'Flappy Bird',
          id: 'pr4'
        },
        {
          name: 'ToDo pwa',
          id: 'pr5'
        },
        {
          name: 'Portfolio',
          id: 'pr6'
        },
        {
          name: 'Hangman',
          id: 'pr7'
        }
      ]
    };
  }
  render(){
    return (
      <div className="App">
        <CardList projects={this.state.projects} />
      </div>
    );
  }
}

export default App;
